import React from 'react';
import Pokemon from './Pokemon';

class Header extends React.Component {
  render() {
    return (
      <header>
        {this.props.pokemons.map(pokemon => <Pokemon key={pokemon.id} pokemon={pokemon} />)}
      </header>
    );
  }
}

export default Header;
